import React from 'react';
import Github from '../assets/images/utilities/img_github.png';
import Expo from '../assets/images/utilities/img_expo.png';
import Notion from '../assets/images/utilities/img_notion.png';
import Codesandbox from '../assets/images/utilities/img_codesandbox.png';
import Codepen from '../assets/images/utilities/img_codepen.png';
export const UtilityList = [
    {   
        id:"1",
        name:"Github",
        source:Github,
        url:"https://github.com/",
    },
    {   
        id:"2",
        name:"Expo",
        source:Expo,
        url:"https://expo.io/",
    },
    {   
        id:"3",
        name:"Notion",
        source:Notion,
        url:"https://www.notion.so/",
    },
    {   
        id:"4",
        name:"Codesandbox",
        source:Codesandbox,
        url:"https://codesandbox.io/",
    },
    {
        id:"5",
        name:"Codepen",
        source:Codepen,
        url:"https://codepen.io/",
    }
]
